import React from "react";

const ContactItem = ({ contactApi }) => {
  return (
    <>
      <div className="icons-container">
        {contactApi.map((e) => {
          return (
            <div className="icons">
              <i className="fas fa-envelope"></i>
              <h3> my email</h3>
              <p>smsiam696@gmail.com</p>
              <p>syedsiam2607@gmail.com</p>
            </div>
          );
        })}

        <div className="icons">
          <i className="fas fa-phone"></i>
          <h3> my phone</h3>
          <p>+8801722-166151</p>
          <p>+8801557-722812</p>
        </div>

        <div className="icons">
          <i className="fas fa-map-marker-alt"></i>
          <h3> my address</h3>
          <p>kahalu upazilla, kahalu, bogura, bangaldesh</p>
        </div>
      </div>
    </>
  );
};

export default ContactItem;
